const LongCopy = () => {
    return(
        <div className="longcopy transition">
            <div className='lc-body robo200'>
                <span className='lc-body-span'>Sports Betting is rigged in favor of the sportsbooks.<br /></span> 
                <span className='lc-body-span'>SimBull is a long term market to eliminate the sportsbook's edge and give you back the upperhand.<br /> </span> 
                <span className='lc-body-span'>You can trade teams like stocks and earn cash everytime your teams win.</span> 
            </div>
        </div>
    )
}

export default LongCopy
